import React from 'react';
import logo from './logo.svg';
import './App.css';
import ItemList from './Components/ItemList';
import Cart from './Components/Cart';

function App() {
  return (
    <div className="App">
      <header className="App-header1">
        <h2>Shopping Cart</h2>
      </header>
      <div id="itemList">
        <ItemList></ItemList>
          <ul>
            <li>Items Go Here</li>
          </ul>
        </div>

        <div id="cart">
          <Cart handleItemChoice={this.updateState.bind(this)}></Cart>
        </div>
    </div>
  );
}

export default App;
